#     def __init__(self, x):
#         self.val = x
#         self.next = None
class Solution:
    def hasCycle(self, head: ListNode) -> bool:
        if head is None:
            return False

        head.append(head.next)

        while head:
            if head.val == head.next.val:
                return True
            head = head.next
        return False

